import { Link } from 'react-router-dom';

const ProductsPage = () => {
    return (
        <>
            <h1>My Products</h1>
            <ul>
                <li><Link to="/prod/p1">My Product 1</Link></li>
                <li><Link to="/prod/p2">My Product 1</Link></li>
                <li><Link to="/prod/p3">My Product 2</Link></li>
                <li><Link to="/prod/p4">My Product 3</Link></li>
                <li><Link to="/prod/p5">My Product 4</Link></li>
                <li><Link to="/prod/p6">My Product 5</Link></li>
            </ul>
        </>
    );



}
export default ProductsPage;
